	$("#level").change(function(){//等级添加监听
		var id=$(this).val();//获取等级
		$("#info").children().remove();//移除所有
		if(id=="我的代理"){
			for(var key in map){
				var  options=map[key];
				for(var i=0;i<options.length;i++){
					var vt=options[i];
					$("<option value="+vt[0]+">"+vt[1]+"</option>").appendTo($("#info"));
				}
			}
			$("#info").show();
			$("#dlname").val("");
			$("#dlname").hide();
		}else if(id=="输入编号"){
			$("#dlname").attr("name","dlname");
			$("#dlname").attr("placeholder","代理编号");
			$("#dlname").show();//姓名框显示
			$("#info").hide();//隐藏选择框
		}else if(id=="普通客户"){
			$("#dlname").show();//姓名框显示
			$("#info").hide();//隐藏选择框
			$("#dlname").attr("name","cname");
			$("#dlname").attr("placeholder","客户姓名");
		}else{
			$("#info").show();
			$("#dlname").val("");
			$("#dlname").hide();
			var options=map[id];
			for(var i=0;i<options.length;i++){
				var vt=options[i];
				$("<option value="+vt[0]+">"+vt[1]+"</option>").appendTo($("#info"));
			}
		}
	});
	//number数量
	var ns=$("#nstd").find("input").length+1;
	//下一步添加监听
	$("#nextbt").click(function(){
		if($("#info").children().length!=0||$("#info").val()!=""){
		check();
		}else{
			alert("亲,您还没有选择任何代理商");
		}
			});
	//返回添加监听
	$("#lastbt").click(function(){
			for(var i=1;i<ns;i++){
				var m=$("#m"+i);
				var f=$("#f"+i);
				var e=$("#e"+i);
				//显示所有框
				f.show();
				e.show();
				if($("#type").val()==0){//串号
				m.show();
				}
				//设置为可写
				f.removeAttr("readonly");
				e.removeAttr("readonly");
				//激活输入框
				f.removeAttr("disabled");
				e.removeAttr("disabled");
				
				//隐藏确认,返回
				$("#nextbt").show();
				$("#res").show();
				$("#sub").hide();
				$("#lastbt").hide();
		}	
	});
	//确认添加监听
	$("#sub").click(function(){
		$("#form").submit();
	});
	function check(){
		var hs=false;
		var can=true;
		if($("#type").val()==0){//串号
			for(var i=1;i<ns;i++){
				var m=$("#m"+i);
				var f=$("#f"+i);
				var e=$("#e"+i);
				if(f.val()!=""&&e.val()!=""){//如果不为空
					if(f.val()-e.val()>0||e.val()-f.val()>20){//前者比后者大,后者比前者大20
						can=false;
						f.focus();//聚焦
						break;
					}else{//符合要求
						hs=true;
					}
				}else if(f.val()==""&&e.val()==""){
					
				}else{//有一个为空
					can=false;
				}
			}
			if(can){//如果填写规范,移除没填写的
				if(hs){
				for(var i=1;i<ns;i++){
					var m=$("#m"+i);
					var f=$("#f"+i);
					var e=$("#e"+i);
					m.hide();
					if(f.val()==""&&e.val()==""){
						f.hide();
						e.hide();
						//禁用输入框
						//f.attr("disabled","true");
						f.attr("disabled","disabled");
						//e.attr("disabled","true");
						e.attr("disabled","disabled");
					}	
					//将其设置为不可以写
					//f.attr("readonly","true");
					f.attr("readonly","readonly");
					//e.attr("readonly","true");
					e.attr("readonly","readonly");
				}
				$("#nextbt").hide();
				$("#res").hide();
				$("#sub").show();
				$("#lastbt").show();
			}else{
				alert("亲,您还没有填写任何值");
			}
			}else{
				alert("亲,请规范填写(每组最多20)");
			}
		}else{//单号
			for(var j=1;j<ns;j++){
			var f=$("#f"+j);
			var e=$("#e"+j);
			if(f.val()!=""||e.val()!=""){
				hs=true;
			}
			}
			if(hs){
				for(var i=1;i<ns;i++){
					var f=$("#f"+i);
					var e=$("#e"+i);
					if(f.val()==""){
					f.hide();
					//禁用输入框
					//f.attr("disabled","true");
					f.attr("disabled","disabled");
					}
					if(e.val()==""){
					e.hide();
					//禁用输入框
					//e.attr("disabled","true");
					e.attr("disabled","disabled");
					}
					//将其设置为不可以写
					//f.attr("readonly","true");
					f.attr("readonly","readonly");
					//e.attr("readonly","true");
					e.attr("readonly","readonly");
				}
				$("#nextbt").hide();
				$("#res").hide();
				$("#sub").show();
				$("#lastbt").show();
			}else{
				alert("亲,请填写编号");
			}
		}
	}
