	//添加selector
	function addSelector(map){
		var select=$("<select/>").appendTo($("#sd"));
		for(var key in map){
		var option=$("<option value="+key+">"+map[key]+"</option>").appendTo(select);
	    }
		 select.addClass("text3");
		 var width=$("#sd").width()+select.width();
		 $("#sdiv").width(width);
		 return select;
	}
	function addSec(sec){
		sec.change(function(){//添加onChange事件
			var width=0;
			sec.nextAll().each(function(){
				width+=$(this).width();
			});
			sec.nextAll().remove();//先移除后面的同级元素
			//将减去width
			width=$("#sd").width()-width;
			$("#sdiv").width(width);
			var uid=sec.val();//获取当前选择的用户id
			//记录此值
			$("#uid").val(uid);
			var path="ajax!getUser?uid="+uid;//请求地址
			var width=0;
			$.getJSON(path,function(data){//获取数据,callBack处理
				 map=data.userInfo;
				 if(map!=null){//如果map存在
					 alert("存在,正在递归");
				 var select=addSelector(map);//增加一个Selector
				 addSec(select);//递归
				 }
			});
		});
	}
